import React from "react";
import "../styles/Education.css";
//import collegiateLogo from "../company-logos/collegiate.jpeg";
//import tutoringLogo from "../company-logos/tutoring.png";

const Education = () => {
  const education = [
    {
      school: "University of California, Berkeley",
      degree: "B.S. in Computer Science and Statistics",
      duration: "2023 - 2027",
      location: "Berkeley, CA",
      gpa: "3.8/4.0",
      description: "Focusing on backend development, ML/AI, and probabilistic risk assessment.",
      experiences: [
        {
          title: "College Counseling",
          company: "Collegiate Consulting",
          companyUrl: "https://www.collegiate-consulting.com/",
          duration: "2023 - Present",
          location: "Berkeley, CA",
          //logoUrl: collegiateLogo,
          description: "Providing guidance to high school students on college applications, course selection, and academic planning. Helping students navigate the UC application process and prepare for standardized tests."
        },
        {
          title: "Academic Tutoring",
          company: "UC Berkeley Student Learning Center",
          companyUrl: "https://slc.berkeley.edu/",
          duration: "2023 - Present",
          location: "Berkeley, CA",
          //logoUrl: tutoringLogo,
          description: "Tutoring students in mathematics, computer science, and statistics. Creating personalized study plans and helping students develop effective learning strategies."
        }
      ]
    }
  ];

  const courses = [
    {
      category: "Computer Science",
      items: [
        { name: "Structure and Interpretation of Computer Programs", code: "CS 61B", link: "https://cs61b.org/" },
        { name: "Machine Learning", code: "CS 189", link: "https://cs189.org/" },
        { name: "Software Engineering", code: "CS 169", link: "https://cs169.org/" }
      ]
    },
    {
      category: "Statistics & Data Science",
      items: [
        { name: "Probability Theory", code: "STAT 134", link: "https://www.stat.berkeley.edu/~aldous/134/" },
        { name: "Statistical Inference", code: "STAT 135", link: "https://www.stat.berkeley.edu/~wfithian/courses/stat135/" },
        { name: "Data Science", code: "STAT 140", link: "https://www.stat.berkeley.edu/~wfithian/courses/stat140/" }
      ]
    },
    {
      category: "Mathematics",
      items: [
        { name: "Linear Algebra", code: "MATH 54", link: "https://math.berkeley.edu/~nadler/54.html" },
        { name: "Multivariable Calculus", code: "MATH 53", link: "https://math.berkeley.edu/~nadler/53.html" },
        { name: "Discrete Mathematics", code: "CS 70", link: "https://cs70.org/" }
      ]
    }
  ];

  return (
    <div className="education-container">
      <h1>Education</h1>
      
      {/* Courses Section */}
      <section className="courses-section">
        <h2>Relevant Courses</h2>
        <div className="courses-grid">
          {courses.map((category, index) => (
            <div key={index} className="course-category">
              <h3>{category.category}</h3>
              <div className="course-list">
                {category.items.map((course, courseIndex) => (
                  <a 
                    key={courseIndex} 
                    href={course.link}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="course-item"
                  >
                    <div className="course-info">
                      <span className="course-code">{course.code}</span>
                      <span className="course-name">{course.name}</span>
                    </div>
                  </a>
                ))}
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Educational Experience Section */}
      <section className="education-experience">
        <h2>Educational Experience</h2>
        <div className="education-timeline">
          {education.map((edu, index) => (
            <div key={index} className="education-card">
              <div className="education-header">
                <h3>{edu.school}</h3>
                <span className="duration">{edu.duration}</span>
              </div>
              <div className="education-details">
                <div className="degree">{edu.degree}</div>
                <div className="location">{edu.location}</div>
                <div className="gpa">GPA: {edu.gpa}</div>
                <p className="description">{edu.description}</p>
                
                {/* Educational Experiences */}
                <div className="edu-experiences">
                  {edu.experiences.map((exp, expIndex) => (
                    <div key={expIndex} className="edu-exp-item">
                      <div className="edu-exp-header">
                        <div className="edu-exp-title">
                          <div className="company-logo">
                            <img src={exp.logoUrl} alt={`${exp.company} logo`} />
                          </div>
                          <div className="edu-exp-info">
                            <h4>{exp.title}</h4>
                            <a 
                              href={exp.companyUrl}
                              target="_blank"
                              rel="noopener noreferrer"
                              className="company-link"
                            >
                              {exp.company}
                            </a>
                          </div>
                        </div>
                        <div className="edu-exp-meta">
                          <span className="location">{exp.location}</span>
                          <span className="duration">{exp.duration}</span>
                        </div>
                      </div>
                      <p className="edu-exp-description">{exp.description}</p>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};

export default Education;
